import{_ as t,v as e,b as l,R as a}from"./chunks/framework.5ffcbaff.js";const d="data:image/png;base64,",i="/docs/cocos/assets/builtin-effect.7b5c656e.png",b=JSON.parse('{"title":"内置着色器","description":"","frontmatter":{},"headers":[],"relativePath":"zh/manual/shader/effect-builtin.md","filePath":"zh/manual/shader/effect-builtin.md"}'),r={name:"zh/manual/shader/effect-builtin.md"},f=a('<h1 id="内置着色器" tabindex="-1">内置着色器 <a class="header-anchor" href="#内置着色器" aria-label="Permalink to &quot;内置着色器&quot;">​</a></h1><p>引擎提供了一系列通用的内置着色器，位于编辑器 <strong>资源管理器</strong> 面板的 <code>internal -&gt; effects</code> 目录下。双击着色器文件即可在外部 IDE 打开进行查看和编辑（前提是需要在 <strong>偏好设置 -&gt; 外部程序</strong> 中配置 <strong>默认脚本编辑器</strong>）。</p><p>Cocos Creator 将内置着色器大致归类为以下几种：</p><ul><li><code>internal</code>：内置引擎功能相关着色器，比如编辑器内用 gizmo，几何体渲染等等。用户通常不需要关注这些。</li><li><code>pipeline</code>：管线特效着色器，包括延迟光照、后效和抗锯齿等。</li><li><code>util</code>：存放一些零散的内置着色器，例如 DCC 材质导入和序列帧动画等。用户通常不需要关注这些。</li><li><code>for2d</code>：2D 渲染相关着色器，如 spine 和 sprite 动画等。</li><li><code>particles</code>：粒子特效相关着色器。</li><li><code>advanced</code>：基于 <a href="./surface-shader.html">表面着色器</a> 制作的一些高级材质，如水面、皮肤、头发、玉石等等，引擎会持续迭代。</li><li>其他的为内置着色器，详情请参考下文说明。</li></ul><h2 id="内置管线特效着色器" tabindex="-1">内置管线特效着色器 <a class="header-anchor" href="#内置管线特效着色器" aria-label="Permalink to &quot;内置管线特效着色器&quot;">​</a></h2><p><img src="'+d+'" alt="管线着色器"></p><table><thead><tr><th style="text-align:left;">着色器名称</th><th style="text-align:left;">说明</th></tr></thead><tbody><tr><td style="text-align:left;">bloom.effect</td><td style="text-align:left;">全屏泛光特效</td></tr><tr><td style="text-align:left;">deferred-lighting.effect</td><td style="text-align:left;">用于延迟管线中的光照处理阶段</td></tr><tr><td style="text-align:left;">planar-shadow.effect</td><td style="text-align:left;">平面阴影</td></tr><tr><td style="text-align:left;">post-process.effect</td><td style="text-align:left;">后处理</td></tr><tr><td style="text-align:left;">skybox.effect</td><td style="text-align:left;">天空盒</td></tr><tr><td style="text-align:left;">smaa.effect</td><td style="text-align:left;">SMAA 抗锯齿</td></tr><tr><td style="text-align:left;">tonemap.effect</td><td style="text-align:left;">引擎预留</td></tr></tbody></table><h2 id="内置着色器-1" tabindex="-1">内置着色器 <a class="header-anchor" href="#内置着色器-1" aria-label="Permalink to &quot;内置着色器&quot;">​</a></h2><p><img src="'+i+'" alt="内置着色器"></p><table><thead><tr><th style="text-align:left;">内置材质着色器名称</th><th style="text-align:left;">说明</th></tr></thead><tbody><tr><td style="text-align:left;">builtin-standard.effect</td><td style="text-align:left;"><a href="./effect-builtin-pbr.html">基于物理的光照模型 PBR</a></td></tr><tr><td style="text-align:left;">builtin-terrain.effect</td><td style="text-align:left;">地形系统默认着色器</td></tr><tr><td style="text-align:left;">builtin-billboard.effect</td><td style="text-align:left;">公告板<br>公告板是一种使物体始终朝向摄像机的渲染方案，适用于树木，血条等渲染</td></tr><tr><td style="text-align:left;">builtin-toon.effect</td><td style="text-align:left;"><a href="./effect-builtin-toon.html">卡通渲染</a></td></tr><tr><td style="text-align:left;">builtin-camera-texture.effect</td><td style="text-align:left;">相机纹理</td></tr><tr><td style="text-align:left;">builtin-unlit.effect</td><td style="text-align:left;"><a href="./effect-builtin-unlit.html">无光照</a></td></tr><tr><td style="text-align:left;">builtin-clear-stencil.effect</td><td style="text-align:left;">清理模板缓存</td></tr></tbody></table><table><thead><tr><th style="text-align:left;">其他内置着色器名称</th><th style="text-align:left;">说明</th></tr></thead><tbody><tr><td style="text-align:left;">builtin-graphics.effect</td><td style="text-align:left;"><a href="./../ui-system/components/editor/graphics.html">Graphics 组件</a> 的着色器</td></tr><tr><td style="text-align:left;">builtin-occlusion-query.effect</td><td style="text-align:left;">遮挡查询</td></tr><tr><td style="text-align:left;">builtin-particle-trail.effect</td><td style="text-align:left;">粒子拖尾</td></tr><tr><td style="text-align:left;">builtin-particle.effect</td><td style="text-align:left;">基于 CPU 渲染的粒子着色器</td></tr><tr><td style="text-align:left;">builtin-particle-gpu.effect</td><td style="text-align:left;">基于 GPU 渲染粒子着色器 <br> 请参考 <a href="./../particle-system/renderer.html">粒子渲染器</a> 了解两个着色器的用法</td></tr><tr><td style="text-align:left;">builtin-reflection-deferred.effect</td><td style="text-align:left;">用于延迟着色中的反射处理</td></tr><tr><td style="text-align:left;">builtin-spine.effect</td><td style="text-align:left;">Spine 骨骼动画的着色器</td></tr><tr><td style="text-align:left;">builtin-sprite.effect</td><td style="text-align:left;">精灵着色器</td></tr><tr><td style="text-align:left;">builtin-sprite-gpu.effect</td><td style="text-align:left;">引擎预留</td></tr><tr><td style="text-align:left;">builtin-wireframe.effect</td><td style="text-align:left;">以线框模式进行绘制</td></tr></tbody></table>',11),n=[f];function s(c,o,y,A,g,u){return e(),l("div",null,n)}const x=t(r,[["render",s]]);export{b as __pageData,x as default};
